      res.header("Access-Control-Allow-Methods", "GET, POST, PUT, PATCH, DELETE")
      return res.status(200).json({})
    }
    next()
})

router(app)

app.listen('9000',() => {
   console.log('Servidor arrancado en http://localhost:9000')
})

