    connection.query('SELECT * FROM Usuario WHERE email=? AND psw=?', [req.body.username,md5(req.body.password)], (err,rows) => {
        if (err) {
            throw err
        } else {
            if (rows.length == 1){
                const payload = {
                    check:  true
                }
                const token = jwt.sign(payload, 'secretpasword', {
                    expiresIn: 1440
                })
